// src/components/PlayerForm.js
import React, { useState } from 'react';
import { registerPlayer, uploadPlayerFiles } from '../api/playerApi';
import { uploadBirthCertificate } from '../api/ocrApi';

export default function PlayerForm({ onRegistered }) {
  const [fields, setFields] = useState({
    full_name_eng: '',
    full_name_nep: '',
    dob_ad: '',
    dob_bs: '',
    gender: '',
    father_name: '',
    mother_name: ''
  });
  const [photo, setPhoto] = useState(null);
  const [birthCert, setBirthCert] = useState(null);
  const [extracting, setExtracting] = useState(false);
  const [submitting, setSubmitting] = useState(false);
  const [error, setError] = useState('');

  // OCR API call
  const handleOCR = async () => {
    if (!birthCert) return setError('Upload birth certificate image first');
    setExtracting(true);
    setError('');
    try {
      const token = localStorage.getItem('token');
      const data = await uploadBirthCertificate(birthCert, token);
      setFields(f => ({
        ...f,
        ...data.extracted // adjust if keys differ
      }));
    } catch (e) {
      setError('OCR failed: ' + (e?.response?.data?.message || e.message));
    }
    setExtracting(false);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSubmitting(true);
    try {
      const token = localStorage.getItem('token');
      // Step 1: Register player (text fields)
      const regResult = await registerPlayer(fields, token);
      const playerId = regResult.player.id;
      // Step 2: Upload photo and birth cert
      await uploadPlayerFiles(playerId, photo, birthCert, token);
      alert('Player registered!');
      onRegistered && onRegistered();
      setFields({
        full_name_eng: '', full_name_nep: '', dob_ad: '', dob_bs: '', gender: '', father_name: '', mother_name: ''
      });
      setPhoto(null);
      setBirthCert(null);
    } catch (e) {
      setError('Registration failed: ' + (e?.response?.data?.message || e.message));
    }
    setSubmitting(false);
  };

  return (
    <form onSubmit={handleSubmit} style={{ maxWidth: 500, margin: '0 auto', padding: 24, border: '1px solid #eee', borderRadius: 8 }}>
      <h2>Player Registration</h2>
      <input required placeholder="Full Name (English)" value={fields.full_name_eng}
        onChange={e => setFields(f => ({ ...f, full_name_eng: e.target.value }))} className="mb-2 w-full p-2" />
      <input required placeholder="Full Name (Nepali)" value={fields.full_name_nep}
        onChange={e => setFields(f => ({ ...f, full_name_nep: e.target.value }))} className="mb-2 w-full p-2" />
      <input required type="date" placeholder="DOB (AD)" value={fields.dob_ad}
        onChange={e => setFields(f => ({ ...f, dob_ad: e.target.value }))} className="mb-2 w-full p-2" />
      <input required placeholder="DOB (BS)" value={fields.dob_bs}
        onChange={e => setFields(f => ({ ...f, dob_bs: e.target.value }))} className="mb-2 w-full p-2" />
      <input required placeholder="Gender" value={fields.gender}
        onChange={e => setFields(f => ({ ...f, gender: e.target.value }))} className="mb-2 w-full p-2" />
      <input required placeholder="Father's Name" value={fields.father_name}
        onChange={e => setFields(f => ({ ...f, father_name: e.target.value }))} className="mb-2 w-full p-2" />
      <input required placeholder="Mother's Name" value={fields.mother_name}
        onChange={e => setFields(f => ({ ...f, mother_name: e.target.value }))} className="mb-2 w-full p-2" />

      <div className="mb-2">
        <label>Photo: <input type="file" accept="image/*"
          onChange={e => setPhoto(e.target.files[0])} /></label>
      </div>
      <div className="mb-2">
        <label>Birth Certificate: <input type="file" accept="image/*"
          onChange={e => setBirthCert(e.target.files[0])} /></label>
        <button type="button" onClick={handleOCR} disabled={extracting || !birthCert} className="ml-2 px-2 py-1 bg-blue-400 text-white">
          {extracting ? 'Extracting...' : 'Extract from OCR'}
        </button>
      </div>
      <button type="submit" className="mt-4 px-3 py-2 bg-green-600 text-white" disabled={submitting}>
        {submitting ? 'Registering...' : 'Register Player'}
      </button>
      {error && <div style={{ color: 'red', marginTop: 8 }}>{error}</div>}
    </form>
  );
}
